                            <div class=""car-details-info blog-content"">

                                <p>
                                    Have you ever wondered how the British army delivers its mail and packages? Well, the same way as everyone. They employ courier services for sending and receiving deliveries. However, unlike regular courier services, couriers in the British army have to undergo a rigorous training process before they can be recruited. The potential risks involved in the job and the sensitive nature of the documents being delivered necessitate such training.
                                </p>

                                <p>
                                    However, being a courier in the army has its perks, too. Aside from the pride that comes from serving the nation, couriers get to travel all over. They enjoy postings to different parts of the globe and get to see the army’s operations up-");
            WriteLiteral(@"close. They also make £15,985 during their training and £20,400 as a private.
                                </p>

                                <p>
                                    An army courier has an important job. They enable soldiers to stay in touch with their family and friends and deliver Protectively Marked Material as required. They use state-of-the-art IT and satellite communication systems to run operations smoothly.
                                </p>

                                <p>
                                    To become a courier, an applicant must meet specific requirements, like falling between the 16 and 35-year age bracket, having a GCSE, and a certain body build and fitness level. If a person meets the initial requirements, they will be put into a training program that has several steps.
                                </p>

                                <p class=""thme-blockquote"">
                                    Even though a person is applying to be ");
            WriteLiteral(@"a courier, the initial training is that of a soldier, covering aspects like fieldcraft and handling rifles. The basic military course can be as long as 23 weeks or last only for 14 weeks, depending on whether you are a Junior Soldier or a Regular Soldier.
                                </p>

                                <p>
                                    The second step is a 15 weeklong Combat Logistician course. The course teaches general service driver modules, gives a broad knowledge of the operations and responsibilities of the Royal Logistic Corps, and lets the candidate practice driving. It culminates with the awarding of category C+E driver license.
                                </p>

                                <p>
                                    Finally, there is a four-week course that teaches the trainee how to use the systems and software that the corps use to track mail. The trainee is also taught how to manage Top Secret materials.
                                </p>");
