                                <p>
                                    The UK land bridge has for long been a traditional route for lorries coming from Ireland and headed to continental Europe. After crossing the Irish Sea, freight would be driven south through Wales and England to cross the channel between Dover and Calais. This route, though indirect, was fast and cheaper than other direct routes between Ireland and France.
                                </p>

                                <p>
                                    With Brexit, there are now border checks and customs formalities that can cause potential delays. Businesses in the EU are choosing to sidestep these customs requirements by staying within the single market and transporting freight by the longer but direct route between Ireland and France across the Irish Sea.
            ");
            WriteLiteral(@"                    </p>

                                <p>
                                    While the UK government has claimed that trade volumes are returning to normal, freight trade across Ireland and Great Britain tells another story. In the third week of February, freight volumes from Ireland to GB on Stena Line ferries were down by 49% compared to last year. In contrast, freight volume going directly to France increased by 102%.
                                </p>

                                <p class=""thme-blockquote"">
