                             ");
            WriteLiteral(@"   </p>

                                <p>
                                    The Rosslare Europort's general manager says the new routes that have opened up between Ireland and the continent are booming. The number of weekly sailings from Ireland to Northern France has gone up three times, compared to last year. In January 2021, freight traffic from Rosslare to the European mainland saw an increase of 446%, compared to 2020.
                                </p>

                                <p>
                                    Government agencies and port authorities have created over 160 new jobs in Rosslare, and local garages and cafes are seeing more business than before. Haulage companies in Ireland have also noticed this increase in freight export. One reason for direct trade within the EU market is that big companies prefer certainty and hassle-free operations.
                                </p>

