                                <p>
                                    Ever Given, the mega-vessel wedged in the Suez Canal is holding an estimated $9bn (£7bn) worth of goods a day and has caused more than 300 container ships to queue up. Most of these ships are carrying products made in the East and meant for Europe and Britain.
                                </p>

                                <p>
                                    The 400-metre Ever Given is as long as the height of the Empire State Building and has been stuck in the canal since Tuesday, the 23rd of March 2021. The ship is among the largest cargo ships in the world and is carrying 20,000 containers. It is operated by Evergreen Marine, a Taiwanese company. Currently, the Suez Canal Authority is trying its best to dislodge the vessel.
                                </p>

      ");
            WriteLiteral(@"                          <p>
                                    About 30% of the world’s shipping containers pass along the Suez Canal, and with the passage currently blocked, goods will reach their destination later than normal, whether ships choose to wait for Ever Given to be dislodged or decide to go the longer route around the Cape of Good Hope.
                                </p>

                                <p class=""thme-blockquote"">
                                    When the ship is dislodged, and the passage for container ships is resumed, there will be a large influx of ships through the canal. Many of these ships will make their way to Felixstowe, Southampton, and Liverpool in the UK. But due to limited dock space in these locations, unloading goods from these ships can take quite some time. There could be some noticeable shortages in the UK, depending on how long the canal disruption lasts.
                                </p>

                                <p>
               ");
            WriteLiteral(@"                     There have been claims that a toilet paper crisis may occur in the coming days if the blockage lasts long enough. If this were to happen, it would come after just one year of supermarkets being short of toilet rolls after frenzy buying before the UK’s first national lockdown.
                                </p>

                                <p>
                                    Since container freight gets most goods to most shops, blockage of containers can impact a whole range of imported goods that people are used to seeing at shops. Producers in the UK who rely on just-in-time supply chains will also see some problems if small parts are not available when needed. If the blockage lasts long enough, it could affect just about anything available at stores. Since oil tankers have also been stuck waiting on either side of the canal, oil prices have gone up and shipping rates for fuel tankers have also increased.
