                                <p>
                                    Truck drivers and logistics workers have been crucial to keeping the economy running during the coronavirus pandemic. Logging thousands of miles, drivers have delivered critical medical supplies and everyday goods to homes across the nation. The latest deliveries being made are the coronavirus vaccines. However, truck drivers delivering vaccines have, in many cases, not being vaccinated themselves.
                                </p>

                                <p>
                                    As the vaccine rollout is gaining momentum in the US, logistics operators and transport groups argue that their workers should have better access to vaccines. This pushes parcel carriers, truck drivers, and dockworkers into the debate over who should get shots on a priority basis –");
            WriteLiteral(@" a debate that already involves public-transit workers, teachers, and people in the food, utilities, and aviation industries.
                                </p>

