                                    That the coronavirus can impact the front lines of distribution became evident in Southern California when a surge in covid-19 cases caused a reduction in the cargo-handling crews at Long Beach and Los Angeles ports. The result was a slowdown at the gateways and overcrowding in the US supply chains. More than a third of all containers coming into the US arrive at Southern California ports, and the slowing down of operations at these ports prompted the start of vaccinations of dockworkers.
                                </p>

                                <p class=""thme-blockquote"">
                                    However, other logistics operators across the US have not been as lucky. Though the federal recommendations for prioritizing vaccinations consider trans");
            WriteLiteral(@"port workers essential, many local jurisdictions have not made logistics workers eligible for vaccines yet. In Michigan, for example, freight workers can only get the vaccine if they are 65 or older.
                                </p>

                                <p>
                                    Another barrier faced by truck drivers in being vaccinated is that they are frequently on the road and often spend weeks delivering goods across states. Vaccinations are distributed to states based on their population, and local jurisdictions are primarily responsible for administering shots to people. However, truck drivers cannot easily be present to get a shot at a specific time or place. Even if they get one shot in their home state, they cannot abandon work to come back and get the second shot three weeks later.
                                </p>

                                <p>
                                    The American Trucking Association is calling for prioritizing vaccine acc");
