                                </p>

                                <p>
                                    The Irish customs authorities are putting part of the blame for these difficulties on businesses being unprepared for new changes. The Irish Revenue Commissioner expressed surprise over some companies failing to address the work that should have been completed in the years leading up to 1 January. They also added that, though they recognized the challenges faced by some businesses, as part of the European Union, they had some respo");
            WriteLiteral(@"nsibilities towards the bloc and had to ensure that they did not put the free movement of Irish goods within the EU at risk.
