                                <p>
                                    The Freight Transport Association Ireland wrote to the Irish Prime Minister, intimating that lorries are getting stranded at Dublin Port or stuck in UK depots because of the new customs and food safety formalities. A shortage of customs agents who can correctly process declarations has created a backlog of goods including food s");
