                            <div class=""car-details-info blog-content"">

                                <p>
                                    Suez Canal is a 120-mile water passage that links the Mediterranean and the Red Sea and provides huge cargo ships a relatively direct route from Asia to Europe. The other route available to ships heading out to Europe from Asia involves a 3,500-mile diversion around Africa. On March 23rd, 2021, MV Ever Given –a Japanese-owned mega-ship – got stuck in the canal and blocked the route for ships from both sides.
                                </p>

                                <p>
                                    According to shipping experts, the disruption is massive and could cause cargo delays around the world. An estimated 300 ships are waiting to cross the currently blocked canal. Some ships have decided to take the detour around Africa, which can add seven days to the journ");
            WriteLiteral(@"ey.
                                </p>

                                <p>
                                    12% of the world’s trade passes through the Suez Canal, and ships carry about $1tn worth of goods per year. On an average day, around 50 ships carrying anywhere between $3bn to $9bn worth of cargo cross the canal. The passage of such goods was blocked when the Ever Given – a quarter-mile long and 200,000 tonnes heavy ship – was wedged across the Suez Canal in Egypt.
                                </p>

                                <p class=""thme-blockquote"">
                                    The bulk of traffic in Suez is made up of container ships. Right now, Ever Given alone is carrying 20,000 containers. Combined with the goods carried by other container ships that cannot currently pass through the canal, a lengthy delay in salvaging the ship can cause delays in supply chains worldwide that could cause prices to go up for essential goods and oil.
                                <");
            WriteLiteral(@"/p>

                                <p>
                                    While shipping is a resilient industry, even minor disruptions in shipments can affect supply chains and supply and demand drastically. Goods and commodities can be time-critical and perishable, while medical equipment could be in critical demand.
                                </p>

                                <p>
                                    There have been some fears that cargo ships are now just too big to ensure safe passage, but they are mostly baseless. Ever Given was among 114 similar-sized ships that made the same journey this year without facing any trouble. And with 18,000 transits every year, the last time the Suez Canal was blocked was in 2013 and only for a few hours.
                                </p>

                                <p>
                                    The Suez blockage that is affecting world trade has come at a time when the shipping industry is recovering from supply cha");
