                                <p>
                                    On 11th January, Liu Jin, a food-delivery worker living in Taizhou, China, parked his motorcycle on the roadside and cried for his hard-earned funds before igniting his clothing with fire. Mr. Jin suffered severe injuries but survived. He was protesting against an online delivery service, ELEME Inc., which he accused of not paying him his earnings.
                                </p>

                                <p>
                                    Protests by gig-economy workers have become more frequent, and the widespread labour unrest is apparent, according to the China Labour Bulletin (CLB), a non-governmental organization based in Hong Kong. In 2019, there were 142 reported protests by transport and logistics workers. However, the CLB suspects that this accounts for onl");
            WriteLiteral(@"y a tenth of the actual demonstrations.
                                </p>

                                <p>
                                    In response, the Chinese government has tried persuading gig-economy workers to join a trade union. In 2015, the All-China Federation of Trade Unions (ACFTU), an umbrella organization encompassing all unions, was planned to be “experimentally reformed.”
                                </p>

                                <p class=""thme-blockquote"">
                                    According to state media, the objective is to make the federation establish measures to help workers and decrease “instability.” In an attempt to discourage protests, it focused on providing memberships to rural migrants and release apps to make the process easier. In 2018, the ACFTU announced plans to recruit eight groups of non-factory workers. This includes about four million couriers and seven million food-delivery workers. However, new unions have a bad history of tryi");
            WriteLiteral(@"ng to look appealing to gig workers. Students at the Chinese University of Hong Kong believe that since unions are part of the Communist Party, union officials are civil servants and therefore unable to do anything that the government policy doesn’t permit.
                                </p>

                                <p>
                                    Before 2015, small labour NGOs achieved some prominent victories advocating for workers’ rights. In 2011, in response to a strike, managers at a Citizen watch factory agreed to pay up 70% of the overtime money earned five years ago.
                                </p>

                                <p>
                                    In 2015, the Communist Party suppressed all major civil-society groups after workers at a shoe factory forced the company to give away millions of yuan in social insurance contribution arrears.
                                </p>

                                <p>
                                 ");
            WriteLiteral(@"   In 2018, workers at a welding factory in Shenzhen attempted to form and register a worker led union with the federation. It resulted in the workers being fired and the police arresting several dozen students and workers for supporting the union.
                                </p>

                                <p>
                                    According to CLB, thousands of couriers have been killed or injured in the past two years. As most couriers are independent contractors, the common person is unconvinced that the union reforms will be able to improve the trying work conditions.
                                </p>

