                            <div class=""car-details-info blog-content"">

                                <p>
                                    The UK and the EU concluded a last-minute trade deal before Christmas last year. In the trades deal, the two bodies agreed that trade across their borders would continue to be free. The trades deal has helped businesses to mostly go on as before. However, as customers are finding now, some taxes are being exacted now which did not exist earlier.
                                </p>

                                <p>
                                    As per the new rules and regulations, when customers in the UK order products online from European-based firms, they have to pay additional money to courier firms. This extra amount can be VAT charges, custom duties, or handling fees. Many customers in the UK are unaware of these additional charges.
                                </");
            WriteLiteral(@"p>

                                <p class=""thme-blockquote"">
                                    When customers in the UK buy goods costing more than £39, they have to pay VAT charges, which can be around 20%. For items costing more than £135, further custom charges may also apply if the sender has not paid them. These can range from 0 to 25%.
                                </p>

                                <p>
                                    These customs charges and VAT charges are the responsibility of the customers, not the retailers. Further, the customs charges cannot be paid in advance, nor does the customer know how much they will be charged in taxes when they place an order. The costs are levied after the product reaches the UK. Courier firms collect these charges on behalf of the government before the delivery is made. In many cases, the only way a customer can receive a parcel is after paying these costs.
                                </p>

                                <p");
            WriteLiteral(@">
                                    But these aren’t the only issues that have resulted from Brexit. Customers are finding that deliveries are typically a week late as they are held up in customs checks. Further, courier services across the UK have started charging customers small fees per delivery. They are meant to cover the costs these couriers are incurring due to increased paperwork and extra customs checks. These “handling fees” are a personal business decision of the independent courier services.
                                </p>

                                <p>
                                    The customs and VAT charges and the handling fees aren’t payable only when a customer orders a product, but they also have to be paid when someone in the UK receives a gift from the EU.
                                </p>

                                <p>
                                    But the complications don’t end here. If a customer doesn’t like the product they ordered online, ");
            WriteLiteral(@"they are well within their rights to return it. However, now customers might have to spend money to send it back. Some disputes may likely arise when customers are asked to pay costs that they think are “hidden costs” and that they do not want to pay.
                                </p>

