                                <p>
                                    The year 2020 saw back and forth talks between the UK and the EU as both tried to arrive at a mutually beneficial trade deal. Finally, they came to an agreement on 24 December 2020. The new deal places no restrictions on the number of things that can be traded between the UK and the EU; neither does it impose any cross-border taxes on goods transported between the two trading entities. However, there are additional paperwork requirements at the border which can create a potential for delays.
                                </p>

                                <p>
                                    In 2020, anticipating delays at the border between Europe and the UK and the possibility of a no-deal outcome, a new ferry freight route opened between Ireland and France, connecting Dunk");
            WriteLiteral(@"irk and Rosslare. This route was set to operate from 2 January 2021 to provide direct and paperless passage between EU countries.
                                </p>

                                <p>
                                    Before the Brexit, the UK provided a land bridge between Ireland and European countries like France, Germany, Belgium, and the Netherlands. Goods from such European countries would move by road to Holyhead port, the second-largest port in the UK. They would then be transported to Ireland by water.
                                </p>

                                <p>
                                    However, Holyhead port’s operators report that their lorry traffic has fallen to one-third of the usual capacity. This is because much of the goods transport between Ireland and European countries is now taking place directly through the Dunkirk and Rosslare route. Ships are also running between Rosslare and Cherbourg.
                                </p>

     ");
            WriteLiteral(@"                           <p class=""thme-blockquote"">
                                    The new trade routes are meant to reduce the EU countries’ dependence on the UK land bridge and facilitate trade between the single market of the EU. It is also a means of sidestepping the paperwork regulations required at the UK’s Holyhead port.
                                </p>

                                <p>
                                    But these are not the only reasons why the Holyhead port is operating at 30-40% of its capacity. The fact is that hauliers only want convenience and ease in shipping processes. Currently, border checks require drivers to provide a negative coronavirus test when crossing from France to the UK. This, combined with the other paperwork requirements, has significantly brought down the port traffic, especially when compared with the boom around Christmas time.
                                </p>

                                <p>
                                  ");
            WriteLiteral(@"  The UK land bridge is a cheaper and quicker option for transporting goods between EU countries and Ireland. It is expected that when people get used to the paperwork formalities at the border and when the coronavirus situation settles down, lorry traffic at the Holyhead port will pick up again.
